/* eslint-disable */
import Vue from 'vue'
import VueRouter from 'vue-router'
import login from "../modules/Account/Views/login"

Vue.use(VueRouter)

const routes = [
  {
    path: '/login',
    name: 'login',
    component: login
  },
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.VUE_APP_BASE_URL,
  routes
})

export default router
